import React, { Component } from "react";
import Slider from "react-slick";

//array of objects
const slides = [
    {
        name: "Slide 1"
    },
    {
        name: "Slide 2"
    },
    {
        name: "Slide 3"
    }
]

class Carousel extends Component {
  render() {
    const settings = {
      className: "slides",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500,
      dots: true,
      arrows: true
    };
    return (
      <div>
        <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      </div>
    );
  }
}

export default Carousel;
